import React from "react";
import styled from "styled-components";

export default function SlideComponent() {
  return (
    <SideBarContainer>
      <ul>
        <li>
          <a href="">
            <span>Connnet On Facebook</span>
            <img src="/Images/instagram.png" alt="MyHospitalWebApp" />
          </a>
        </li>
        <li>
          <a href="">
