          </a>
        </li>
        <li>
          <a href="">
            <span>Connnet On Facebook</span>
            <img src="/Images/instagram.png" alt="MyHospitalWebApp" />
          </a>
        </li>
        <li>
          <a href="">
            <span>Connnet On Facebook</span>
            <img src="/Images/instagram.png" alt="MyHospitalWebApp" />
          </a>
        </li>
      </ul>
    </SideBarContainer>
 
  );
}

const SideBarContainer = styled.div`
  display: inline-flex;
  ul {
    display: inline-flex;
    flex-direction: column;
    list-style: none;
    position: relative;
    left: -43px;
    li {
      display: inline-flex;
      /* margin-left: -194px; */
      background-color: #090b13;
      transition: all 250ms cubic-bezier(0.25, 0.46, 0.45, 0.94) 0s;
      border-radius:4px;
      a {
        display: flex;
        align-items: center;
        text-decoration: none;
        span {
          margin-right: 15px;
          color: white;
          font-family: "Raleway", sans-serif;
          /* transition: all 250ms cubic-bezier(0.25, 0.46, 0.45, 0.94) 0s; */
          display: none;
        }
        img {
          width: 50px;
          margin: 4px;
          filter: invert(100%);
        }
      }

      &:hover {
        /* margin-left: -4px; */
        span{
          display: block;
        }
      }
    }
  }
`;
